const Header =()=> {

    return (
        <header className="header" id="header">
            <div className="container">
                <h1 className="display-1 text-capitalize text-center">Travel log</h1>
                <p className="header-text text-center fst-italic">"All the places i been and some places i would love to visit one day"</p>
            </div>
        </header>
    )
}

export default Header
